import React from "react";

const Sidebar = () => {
  const place = document.querySelector(".sidebar");
  const toolbarItems = ["Home", "about", "contacts", "login", "register"];
  function creater() {
    toolbarItems.map((x) => {
      place.innerHTML += `<div>${x}</div>`;
    });
  }
  creater();
  return <div className="sidebar"></div>;
};

export default Sidebar;
